	public void xtestVerification() {
		log("start verification");		
	
		try {
			String transactionId = "004-2016-000003";
			String nin = "004-2016-000003";
			List<ImageFingerprintDto> fingerprints = new ArrayList<ImageFingerprintDto>();
			ImageFingerprintDto fp = null;
			for (int i=1; i<=10; i++) {
				byte[] imageData = this.loadFingerprintImage("candidate1/FP_0"+i);
				if (imageData!=null) {
					fp = new ImageFingerprintDto();
					fp.setFingerPosition((short) i);
					fp.setImageType(ImageType.WSQ);
					fp.setImageData(imageData);
					fingerprints.add(fp);
				}
			}
			SubjectDto output = bean.verification(transactionId, nin, fingerprints);
			log("SubjectDto: "+output+"\n"+ReflectionToStringBuilder.toString(output, ToStringStyle.MULTI_LINE_STYLE));

		} catch (FaultException e) {
			e.printStackTrace();
		}
		
		log(" end  verification");
	}
	
	private String rootFolder = "D:/NIC-1.0/nic-parent/nic-ws/src/test/resources/";
	public static final String FINGERPRINT_DATA_ROOT = "";
	private byte[] loadFingerprintImage(String index){
		try {
			String fileName = rootFolder + FINGERPRINT_DATA_ROOT + index + ".wsq";
			File file = new File(fileName); 
			if (file.exists()) {
				byte[] data = FileUtils.readFileToByteArray(file);
				return data;
			}
		} catch (IOException e) {
			e.printStackTrace();
		}
		return null;
	}
	
	public static void log(String message) {
		System.out.println(message);
	}
